import React from 'react'
import ResultComponent from './ResultComponent'

const ResultsComponent = ({results}) => {
    return (
       <section>
           {results.map(result => (
               <ResultComponent key = {resul} result = {result} />
           ))}
       </section>
    )
}



export default ResultsComponent
